"use client"
import Image from 'next/image';
import classNames from 'classnames/bind';
import { useState } from 'react';
import styles from './Description.module.sass';
export const PLACEHOLDER_IMAGE="data:image/png;base64,"

export const Description = () => {
  const [hasBorder, setBorder] = useState(false);

  const handleClick = () => setBorder(!hasBorder);

  const cx = classNames.bind(styles);

  const buttonStyles = cx('Description__button', {
    'Description__button--border': hasBorder,
  });


  return (
    <section className={styles.Description}>
      <button onClick={handleClick} className={buttonStyles}>
        <div className={styles.Description__imageContainer}>
          <Image
            src="/images/logo.png"
            alt="products marketplace"
            fill
            placeholder='blur'
            blurDataURL={PLACEHOLDER_IMAGE}
          />
        </div>
      </button>
      <div className={styles.Description__text}>
        <h2>Dizoo</h2>
        <p>Bienvenido a Dizoo, tu destino definitivo para encontrar la mejor moda y accesorios para consentir a tu mascota. Nos enorgullece ofrecerte una amplia gama de productos cuidadosamente seleccionados que no solo brindan comodidad, sino que también realzan el estilo y la personalidad de tus adorables compañeros peludos.</p>      </div>
    </section>
  )
}